#region Variables

$iconBase64      = ''

$iconBytes       = [Convert]::FromBase64String($iconBase64)

#endregion

#region Functions

function Send-SMS {

    param(
        [ValidateScript({$_ -match "^\+\d+$"})]
        [string]$MobileNr,

        [string]$Body
    )

    $props = @{
        From = "support@rts.se"
        To = "$MobileNr@qlnk.se"
        SmtpServer = "smtprelay.rts.se"
        Port = 25
        Subject = " "
        Encoding = [System.Text.Encoding]::UTF8
        Body = $Body
        ErrorAction = "Stop"
    }


    try {
        Send-MailMessage @props
        Add-Type -AssemblyName PresentationCore,PresentationFramework
        [System.Windows.Forms.MessageBox]::Show("The SMS has successfully been sent!")
    }
    catch {
        Add-Type -AssemblyName PresentationCore,PresentationFramework
        [System.Windows.MessageBox]::Show("An error occurred while sending SMS:`n`n:$_",'Error','OK','Error')
    }

}


function Send-Topdesk{
    param(
        [ValidateScript({$_ -match "^(#|A|C)[0-9]{4}-[0-9]{4}$"})]
        [string]$TickerNrInput,

        [string]$MobileNr
    )

    $props = @{
        From = "RTSC-SMS@rts.se"
        To = "support@rts.se"
        SmtpServer = "smtprelay.rts.se"
        Port = 25
        Subject = $TickerNrInput
        Encoding = [System.Text.Encoding]::UTF8
        Body = "SMS sent to $MobileNr by $(whoami /UPN).`n`nGenerated by RTSC SMS function."
        ErrorAction = "Stop"
    }


    try {
        Send-MailMessage @props
    }
    catch {
        Add-Type -AssemblyName PresentationCore,PresentationFramework
        [System.Windows.MessageBox]::Show("An error occurred while updating topdesk ticket:`n`n:$_",'Error','OK','Error')
    }
}


function SMS-TICKETNR-GUI {
    param(
