    )

    Add-Type -AssemblyName System.Windows.Forms
    Add-Type -AssemblyName System.Drawing

    $form = New-Object System.Windows.Forms.Form
    $form.Text = 'RTSC SMS - Topdesk ticket number'
    $form.Size = New-Object System.Drawing.Size(370,160)
    $form.StartPosition = 'CenterScreen'

    $okButton = New-Object System.Windows.Forms.Button
    $okButton.Location = New-Object System.Drawing.Point(70,80)
    $okButton.Size = New-Object System.Drawing.Size(75,23)
    $okButton.Text = 'Continue'
    $okButton.DialogResult = [System.Windows.Forms.DialogResult]::OK

    $cancelButton = New-Object System.Windows.Forms.Button
    $cancelButton.Location = New-Object System.Drawing.Point(190,80)
    $cancelButton.Size = New-Object System.Drawing.Size(75,23)
    $cancelButton.Text = 'Cancel'
    $cancelButton.DialogResult = [System.Windows.Forms.DialogResult]::Cancel

    $label1 = New-Object System.Windows.Forms.Label
    $label1.Location = New-Object System.Drawing.Point(10,20)
    $label1.Size = New-Object System.Drawing.Size(280,20)
    $label1.Text = 'Please enter the topdesk ticket number:'

    $textBox1 = New-Object System.Windows.Forms.TextBox
    $textBox1.Location = New-Object System.Drawing.Point(10,40)
    $textBox1.Size = New-Object System.Drawing.Size(320,20)
    if($TicketNrInput){$textBox1.text = $TicketNrInput}

    $form.AcceptButton = $okButton
    $form.Controls.Add($okButton)
    $form.CancelButton = $cancelButton
    $form.Controls.Add($cancelButton)
    $form.Controls.Add($label1)
    $form.Controls.Add($textBox1)

    $stream          = [System.IO.MemoryStream]::new($iconBytes, 0, $iconBytes.Length)
    $form.Icon       = [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::new($stream).GetHIcon()))

    $form.Topmost = $true

    $form.Add_Shown({$textBox1.Select()})
    $result = $form.ShowDialog()

    $stream.Dispose()
    $form.Dispose()

    if ($result -eq [System.Windows.Forms.DialogResult]::OK){
        return $textbox1.text
    }
}




