function Read-TicketNrInput {

    $TicketNrOutput = SMS-TICKETNR-GUI

    if ($TicketNrOutput){
        while($TicketNrOutput -notmatch "^(#|A|C)[0-9]{4}-[0-9]{4}$"){
            Add-Type -AssemblyName PresentationCore,PresentationFramework
            [System.Windows.MessageBox]::Show('Topdesk Ticket number provided is not valid','Error','OK','Error')
            $TicketNrOutput = SMS-TICKETNR-GUI -TicketNrInput $TicketNrOutput

            if(!$TicketNrOutput){
                Exit 0
            }
        }
    }else{
        Exit 0
    }
    return $TicketNrOutput
}



function Read-SMSInput {

    if($SMSInput){
        $param = @{
            mobile  = $SMSInput.Mobile
            msg     = $SMSInput.Message
        }
    }

    $SMSOutput = switch ($Choice) {
        Password    {SMS-PASS-GUI @param}
        FreeText    {SMS-FREE-GUI @param}
    }


    if ($SMSOutput){
        while($SMSOutput.Mobile -notmatch "^\+\d+$"){
            Add-Type -AssemblyName PresentationCore,PresentationFramework
            [System.Windows.MessageBox]::Show('Mobile phone number provided is not valid','Error','OK','Error')
            $SMSOutput = switch ($Choice) {
                Password    {SMS-PASS-GUI -mobile $SMSOutput.Mobile -msg $SMSOutput.Message}
                FreeText    {SMS-FREE-GUI -mobile $SMSOutput.Mobile -msg $SMSOutput.Message}
            }

            if(!$SMSOutput){
                Exit 0
            }
        }
    }else{
        Exit 0
    }
    return $SMSOutput
}
#endregion







#########################################################################


#region Script run

if ($TicketNr = Read-TicketNrInput){

    if ($Choice = SMS-CHOICE-GUI){
        $SMSInput = Read-SMSInput

        while($answer -notlike "Yes"){

            Add-Type -AssemblyName PresentationCore,PresentationFramework
            $msgbuttons=[system.windows.forms.messageboxbuttons]::yesno;
            $answer = [System.Windows.Forms.MessageBox]::Show("Do you want to send the following SMS message to the phone number '$($SMSInput.mobile)':`n`n$($SMSInput.SMS)",'Verify',$msgbuttons,'Question')

            if ($answer -like "No"){
                $SMSInput = Read-SMSInput -tempSMSInput $SMSInput
            }
        }

        Send-SMS -MobileNr $SMSInput.Mobile -Body $SMSInput.SMS
        Send-Topdesk -TickerNrInput $TicketNr -MobileNr $SMSInput.mobile
    }
}
#endregion
